sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		outputs.status = 'Success';
		var response = JSON.parse(inputs.response);
		outputs.order_id = response.order.order_id;
		outputs.application_status = response.order.application_details
			.application_status;
		outputs.event = response.order.application_details
			.application_event;
		outputs.is_rescreen = response.order.application_details
			.is_rescreen;
		outputs.link = response.order.application_details.application_url;
		outputs.meta_data = response.order.meta_data;
	} else
		outputs = new FirstAdvantageSpokeErrorHandler()
		.getInviteStatusByApplicantIdErrorHandler(inputs, outputs);
})(inputs, outputs);

